INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (187,'031','해가 중천에 떠오르면 기울기 시작하고 달도 차오르면 이그러지기 시작하는 법입니다. 촌인이 대작을 하니 촌한 굽음이 몰라 감당하기 어려운 법입니다. 만일에 이사하면 느리게라도 빛을 보게 됩니다. 새해를 안어하면 바람직합니다. 만일 이와 같지 않으면 하던 일을 고치기라도 해야 대길하겠습니다. 봄의 운수는 다른 경영을 꿋해서는 안 되는 차입니다. 여름에는 구설수가 분분하기 쉽습니다. 욕심을 부리는 일은 어찌가지 못할 것이며 즐거운 일을 꿋해 끈에 달하도록 못하고 가는 것은 위험합니다. 아래로서 위를 찌르니 옛것을 고치고 새것을 시작하거나 수정할 수입니다. 분수 밖의 일을 도모하게 된다면 새로운 일만 생기고 유익한 일은 없겠습니다.','남은 눈이 사라지지 않았으니 백가지 흥들이 아직 나오지 못하는 격입니다. 몸이 산곡에 있으니 마음이 심히 고독하고 피곤할 수입니다. 집안 사람끼리 화합하지 못하고 서로 어해하기 쉬우니 은인이 도리어 원수로 변하는 격입니다.','영목사이 몸에 임했으니 한번쯤은 멀리 여행을 가게 되었으나 다른 일은 도모하지 마십시오. 일을 바여도 이익을 얻기는 어렵습니다. 어찌려 해롭지 않음을 고맙게 생각하십시오. 경영하는 일은 머리만 있고 꼬리가 없는 격이니 흉함하기 쉽습니다.','뜻밖의 성공을 거두어 이름이 가까운 곳이나 먼 곳이나 할 것 없이 널리 알려지게 됩니다. 주인이 와서 도와줄 것이니 반드시 성공하게 될 것입니다. 이 달의 운수는 길한 방위가 동쪽과 남쪽에 있으니 그를 유의하고 시작과 버림을 중시해야 합니다.','봄날 파릇파릇한 화초에 서리가 내린 격이니 성장하기 힘들기만 합니다. 설령 성장하더라도 열매치가 않습니다. 만약 손재수가 아니면 구설이 분분할 것이니 조심하십시오. 소나가 길을 잃고 동부서주하나 방향을 분간하지 못하는 격이니 신중해야 합니다.','사람들과 더불어 같이 놀게 되니 길함과 흉함이 반반입니다. 입을 봉마개로 틀어막듯 지체다면 결단 시비에 말려들지 않겠습니다. 집에 있으면 유익하고 후운할 수 있는 운이니 함부로 바깥출입을 하여 실패를 자초하거나 안에 있는 이익을 버리는 일이 없도록 하십시오.','이름이 천리나 만리에 미치게 되어 모르는 이가 없으나 헛되이 이름만 나고 실속은 없는 격입니다. 신수가 꽹꽹치 못하니 몸가짐과 마음가짐을 바르게 해야 합니다. 비록 형이야 아우야 하고 지낸지라도 속마음은 함부로 말하지 마십시오.','강남으로 돌아가는 기러기가 편지를 받으러 전하는 격이니 모든 일에 길함이 있고 과력이 몸에 임했으나 강남으로 돌아가는 기러기가 전하는 소식이니 꿈 느낌 같이 있겠습니다. 만약 가볍게 떠이나 터전을 옮긴다면 불리하니 조심하십시오.','고요하게 앉아 분수를 지키면 대길하고 활동하여 일을 바이면 도리어 불리하게 됩니다. 직분을 지켜가며 편안하게 기거한다면 우연히 재물을 얻을 것이나 찾아 나서면 어찌려 오는 복을 놓치겠습니다. 아름다운 배필을 맞이하게 맞이하기가 쉽지 않겠습니다.','모든 골짜기에서 내려오는 물이 서로 합치니 작은 내가 드디어 바다를 이루는 격입니다. 밖은 실하고 안은 비어서 알아주는 이가 없으니 허전하겠습니다. 그러나 신수가 편안하고 길하니 오지 않는 재물을 한탄하지 마십시오. 마침내 바다를 이루는 격이니 소원 성취하게 될 것입니다.','창이 높은 사분을 열고 하늘을 보는 격이니 좋은 달 모습을 보기가 어렵습니다. 이익을 도모하려면 반드시 동방을 향하는 것이 좋으며 시작하는 일에 신중을 기해야 합니다. 그러나 사람 사귀는 일을 경솔하게 한다면 닥치는 해를 면커 어렵겠습니다.','이달의 운수는 비교적 수고를 많이 하지만 그만큼의 공덕을 얻기가 힘든 운수입니다. 바른 마음으로 신부를 지키고 근신한다면 흉한 것이 변하여 길하게 되겠습니다. 특히달의 운수는 물과 불을 조심해야 하며 주변을 살피지 않으면 후회할 일이 생기겠습니다.','귀인이 바로 곁에 있으니 운수와 이익을 보겠습니다. 마치 가을비가 곡식에 가득 찬 창고를 얻은 격이니 식력이 대길하겠습니다. 첫 달의 운수는 길함이 많고 흉함이 적으니 위험이 기다리고 고독이 심했던 액운도 모두 흘러게 됩니다.','2025-03-02 11:48:40.410386+00','k');
